const int FR_DATA_LEN = 10004;
const double MAX_F =  0.4598;
const double MIN_F = 1.1553e-06 ;


const double MAX_GAMMA = 5.0115;
const double MIN_GAMMA = 0.01;

const double ORDER_N2[] = {1.0/16384, 1.0/4096 ,1.0/1024 , 1.0/256, 1.0/64, 1.0/16, 0.25, 1.0};
const int ORDER2[] = {16384, 4096 ,1024 , 256, 64, 16, 4, 1};


inline int divergent(const double &x,const double &y,const double &z){
    return ((x-y)>z || (y-x)>z);
}

inline int cutGAMMA(double &v){
    if(v>MAX_GAMMA) v = MAX_GAMMA;
    else if(v<MIN_GAMMA) v = MIN_GAMMA;
    else return 0;
    return 1;
}

inline int cutDF(double &v){
    if(v>MAX_DF) v = MAX_DF;
    else if(v<MIN_DF) v = MIN_DF;
    else return 0;
    return 1;
}

// interpolate the snr value with the correspond df value
void interp1(const double &target, double &value){
    int i  = 0;
    for(i=0;i<DATA_LEN;++i){
        if(df[i]<=target && df[i+1]>target){
            value = snr[i] + (snr[i+1]-snr[i])/(df[i+1]-df[i])*(target-df[i]);
            return;
        }
    }
}

// y = interp1(snr,fr, gamma), interpolate the fr value with the correspond gamma value
void interp2(const double &gamma, double &value){
    int i  = 0;
    for(i=0;i<FR_DATA_LEN;++i){
        if(r[i]<=gamma && r[i+1]>gamma){
            value = fr[i] + (fr[i+1]-fr[i])/(r[i+1]-r[i])*(gamma-r[i]);
            return;
        }
    }
}


double mrf_psnr_est(double* weights, const double &gamma, double* eEn){

    double fr[PXL];
    double frr[PXL];
    double mse = 0, mse_ori = 0,psnr = 0, psnr_ori = 0;
    double value = 0.0 ;
    double suppress = 1.0;

    for(int i = 0 ; i < PXL ; ++i){

        value = weights[i]*gamma;
        cutGAMMA(value);
        interp2(value,fr[i]);
//        printf("%lf\n",fr[i]);
        suppress = 1-2*fr[i];

        frr[i] = fr[i]/(fr[i]+(1-fr[i])*exp(eEn[i]*suppress));

        mse+=(frr[i]*ORDER2[i]);
        mse_ori+=(fr[i]*ORDER2[i]);

    }

    psnr = 10*log10(65025/mse);
    psnr_ori = 10*log10(65025/mse_ori);

//    for(i = 0 ; i < PXL ; ++i)
//        printf("%lf,",fr[i]);
//    printf("%lf\n",psnr_ori);

    for(int i = 0 ; i < PXL ; ++i)
        printf("%lf,",frr[i]);
    printf("%lf\n",psnr);

    return psnr;
}

